package main

import (
    "math"
)

// MaxFill calculates the number of times buckets need to be lowered to empty the wells.
func MaxFill(grid [][]int, capacity int) int {
    totalWater := 0

    for _, row := range grid {
        for _, water := range row {
            totalWater += water
        }
    }

    // Calculate the number of times the buckets need to be lowered
    return int(math.Ceil(float64(totalWater) / float64(capacity)))
}
